import style from "./Select.module.css";

function Select(props) {
  const className = props.className
    ? `${style.select} ${props.className} capitalize`
    : `${style.select} capitalize`;

  return (
    <select id={props.id} onChange={props.onChange} className={className}>
      {props.children}
    </select>
  );
}

export default Select;
